import React from 'react';
import { Link } from 'react-router-dom';

import SignUpForm from './signupForm'

const SignUp = () => (
    <div className='signup-page'>
        <Link to="/">{"<- Back to home"}</Link>
        <SignUpForm />
    </div>
)

export default SignUp;
